var helpers = require("./helpers.js");

async function myGoToKeyword(pageUrl, page, logger, playwright) {
    await helpers.custom_keyword(pageUrl, page, logger, playwright)
    await page.goto(pageUrl);
    return await page.title();
}

// Example of importing a module with keywords, a module
// with a page object, and a keyword defined in this file
exports.__esModule = true;
module.exports = {
    ...require('more_keywords'),
    ...require('mypageobject'),
    'myGoToKeyword': myGoToKeyword,
}
